{'author': 'smithers-742-127438', 'dateCreated': '2018-05-17', 'inLanguage': 'English', 'heading': 'Review is Misleading', 'reviewBody': 'The low review for this movie is so misleading. 

Yes, it could be considered underwhelming in terms of drama and action if that&apos;s what you&apos;re looking for. It isn&apos;t Trainspotting 3 and was never meant to be. It&apos;s focus was on emotion and the hold that drug use can have on a family. It was real and not pumped up for the sake of making it a more exciting movie.

The performances, music, and story were fantastic. It&apos;s worth a watch. It will suck you in and really gets across the emotions that everyone in a family goes through when a member battles addiction.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 9}}

{'author': 'eleisha_is_fullysik', 'dateCreated': '2023-01-06', 'inLanguage': 'English', 'heading': 'If you&apos;re thinking of watching, do it!', 'reviewBody': 'I went into this movie with little expectations, and came out with this added to one of my favourite films of all time. I felt every emotion during this experience. I couldn&apos;t picture anyone else play the character of Otto, Tom hanks absolutely nailed it in this. Along with the female lead, she was hilarious and had the whole cinema laughing at times!

I will recommend this film for a long time. I go to the cinema once a week atleast and this has been the best watch in a very long time.

Don&apos;t forget to bring your tissues. It&apos;ll have you on an emotional roller coaster but you won&apos;t want to get off.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 9}}

{'author': 'masonsaul', 'dateCreated': '2023-10-15', 'inLanguage': 'English', 'heading': 'Intense', 'reviewBody': 'Accused puts a very timely spin on the home invasion genre. Creating something of the moment that&apos;s terrifying because even its most ridiculous moments feel all too real. An intense look at the dangers of putting too much of your personal life online and how mob mentality has only gotten worse in a world of social media.

It&apos;s essentially a one man show Chaneil Kular who rises to the task flawlessly. It&apos;s briefly easy going for him in the earlier moments until he sees what&apos;s happening online and then spends the rest of the film in a palpable state of fear which only gets worse as people put words into action for the final stretch.

Philip Barantini is a master of suspense, there&apos;s never a break once things go wrong. The constant escalation is so good and the actual home invasion sequence feels like it goes on forever in the best way. The score by Aaron May and David Ridley further ratchets up the intensity with its oppressive nature.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 8}}

{'author': 'magnoliacream', 'dateCreated': '2023-09-16', 'inLanguage': 'English', 'heading': 'Cinderella with a twist', 'reviewBody': 'Little Red Riding Hood (Kanna Hashimoto), an adventurous and inquisitive girl, sets off on a journey to enrich her life. She meets a bedraggled girl who introduces herself as Cinderella (Yûko Araki). Little Red Riding Hood goes to the ball with her. She also helps authorities uncover a mystery or two.

Those who think this is just another take on an oft-repeated tale, think again. The story is very daring, turning as beloved a fairytale as Cinderella on its head. I bet you would not expect what happens in the end. Question every scene and see if you can find clues along the way.

I actually liked it. Mysteries and twists always entertain when they are plausible. And the story makes them so.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'bob the moo', 'dateCreated': '2020-08-16', 'inLanguage': 'English', 'heading': 'Enjoyable enough b-movie tosh', 'reviewBody': 'Early in this film we get two things pointed out. First we get to meet an old friend of Angel, who is the head of a large private military contractor. Secondly we understand that the President (who is guarded by Angel) is clamping down on private military contractors. The rest of it writes itself from here, and the plot is fairly by the numbers in terms of what it does. Fortunately it has the money to make it look good and have some good action, even if the story is hokum. It helps of course that nothing about it suggests that it is anything more than a B-movie thriller.

It has plenty of military hardware, masculinity, gruff dialogue, and shots of people running with guns; all of which keeps the film moving along reasonably well. If offers nothing more than this. The viewer will know the plot before the film gets there, so one does find that you need the famous faces and solid set pieces to distract; and luckily both do. Engaging but routine action sequences distract, and inbetween I found myself wondering what made Butler into a star, how Perabo looks so terrific when she is the same age as me, whether or not Pinkett-Smith had surgery (well, she clearly did on the basis of this), and if Danny Huston is really a good actor or just has a genetic disposition to being a good screen presence. And on top of that we have Nick Nolte doing top Nolte.

The result is enjoyable enough, but totally forgettable - indeed I often write these little comments months after the facts now due to other time pressures, but in this case I wrote it within a few hours as I figured the film would be gone within a few days. It&apos;s fine as late night TV tosh, but nothing more than that.', 'reviewRating': {'worstRating': None, 'bestRating': None, 'ratingValue': None}}

{'author': 'phd_travel', 'dateCreated': '2023-10-09', 'inLanguage': 'English', 'heading': 'Stylishly violent thriller with star quality leads', 'reviewBody': 'This is the action thriller of the year. It&apos;s been proven before that Korean action thrillers are well done from Man from Nowhere to No Mercy. In Ballerina there is a quick emotional involvement with the characters that grips and then lots of convincing original action. And the actors have star quality and charisma that keeps you watching. So it&apos;s an entertaining gripping watch that isn&apos;t too long. The violence is quite something even for jaded action fans. The fighting is brilliantly choreographed.

A shout out to the leading cast members who really make this show. Terrific female lead Jeong Jeon Seo has an attitude and modern look that suits this type of movie perfectly. Kim Ji Hoon gives another convincing villain performance. He was great in Flower of Evil and he does it again here.

Luc Besson fans will like this one. Though it is less comical than Besson movies.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 8}}

{'author': 'madameminty', 'dateCreated': '2018-02-10', 'inLanguage': 'English', 'heading': 'Surprisingly entertaining, again', 'reviewBody': 'I liked Skyline (2010). It had a lot of action, interesting style (blue/red light, which I interpreted as something the characters don&apos;t actually see), and despite not being particularly smart like Arrival (2016) it was engaging until the ending I found very satisfying. I&apos;m honestly surprised about most reviewers who seem to have expected a different genre altogether and were disappointed the characters aren&apos;t as deep as they think they are ;)

Beyond Skyline is simply more of the same, and I mean it. After it neatly blends with the original, it escalates the action, offers more of the same style (might be a tad too much, though), still not very intelligent yet avoids being unforgivably silly, and even delivers an ending I couldn&apos;t be happier about. It tries to avoid the mistakes of the first movie, like characterisation or dialogue, but it&apos;s debatable whether it worked. Definitely supplements the original and makes the series better than the sum of its parts.

In short, it&apos;s a lot like Independence Day (1996), much better than the sequel (2016) and provides a nice alternative to it.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'mpaulso', 'dateCreated': '2017-08-01', 'inLanguage': 'English', 'heading': 'Zombie Revival', 'reviewBody': 'Train to Busan was a treat. 

A look into Selfishness vs Selflessness and Individual vs The Collective.

I can&apos;t remember the last time I enjoyed a foreign film this much. The cinematography is excellent, the story is original, and I will definitely be keeping an eye on Sang-ho Yeon&apos;s future projects.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 8}}

{'author': 'MovieIQTest', 'dateCreated': '2018-04-29', 'inLanguage': 'English', 'heading': 'What&apos;s the purpose of making this film?', 'reviewBody': 'This is a drive-you-nuts pointless film with two annoying and abnormal private high schoolers, one male and one female who started a debate club and simply couldn&apos;t agree on anything with each other, and both would not back off from their two-member-only debate club for who should be the president of the club, who&apos;s more entitled either by birth date or seniority at school. The main purpose was to falsify on their college application with a title of a club presidency. 

From the very beginning, we just have these two people blah, blah and blah to disagree on everything, chewing up lot of candy from the candy jars on their private school consultant&apos;s desk. We have so many phony and couldn&apos;t-care-less people at school, and two blindly support their kid&apos;s mothers.

We didn&apos;t see anything about the education, the study, the....No, nothing but constantly arguing between these two brats. It&apos;s just getting more and more annoying after awhile. This film is not about the generally normal kids in the public school system but two spoiled private high schoolers who never agreed on anything with each other. I just gave up sooner than later since I couldn&apos;t care less. Netflix may have a lot of money to burn, but they seem to have lost, more like whatever scripts they got, they&apos;d put them into production, no matter what.', 'reviewRating': {'worstRating': None, 'bestRating': None, 'ratingValue': None}}

{'author': 'hitomi69', 'dateCreated': '2017-10-18', 'inLanguage': 'English', 'heading': 'Excellent film', 'reviewBody': 'The story is not that complicated.

But the execution is very good. I was glued to my seat throughout and only breathed with relief (from pressure) when the roller credit came out. It proved that a good movie does not necessarily mean investing huge amount in computer graphics or famous (and costly) stars. All it takes is a good script, talented direction and good acting.

Bravo for Thai film industry!', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 9}}

{'author': 'kiraakamii', 'dateCreated': '2021-08-16', 'inLanguage': 'English', 'heading': 'Only trust your own taste', 'reviewBody': 'Come on, only less than 2000 people rated this, if for some reason you loved it and think it deserves more you are not wrong.

The movie is very Japanese, in the west teenage love is more intense and kids are already doing more than this in their 13s. But understanding how Japanese people are and how they see life and memories as key to their personal growth is esencial for this kind of movies.

The movie is very cute and it is just a little summer story, it won&apos;t change your life or it might, it depends on how you see it.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 8}}

{'author': 'smletony', 'dateCreated': '2023-10-27', 'inLanguage': 'English', 'heading': 'Predictable, yet enjoyable', 'reviewBody': 'There was one important nuance that has made this movie about an imminent and predictable collapse of a get-rich-quick-scheme special and orders of magnitude more enjoyable than your typical crypto scam story: the dude who pointed out halfway through the story how all these self deemed crypto evangelists are harmful to the space and they should read the Bitcoin Standard and study some economics to recognise the Ponzi they got stuck up in.

Props to the writers for adding this, otherwise the film was suitable for a pastime.

Moral of the story: DYOR, invest in Bitcoin, self custody and cut out the noise.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'postolachivalentin', 'dateCreated': '2021-04-25', 'inLanguage': 'English', 'heading': 'Best Tarantino movie and you can&apos;t change my mind', 'reviewBody': 'Jango (D is silence) is just one of those movie you can watch every year and it never gets old.

It&apos;s also the origin of those Di Caprio memes you saw online, so you know is good.

Also Christoph Waltz stole the show here and made me discover all other his movies.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 10}}

{'author': 'IheartCali5882', 'dateCreated': '2011-10-05', 'inLanguage': 'English', 'heading': 'Couldn&apos;t finish it....', 'reviewBody': 'Guess my expectations were too high. I&apos;m a fan of Guillermo Del Toro and so I&apos;m highly surprised he&apos;s attached to this. The gore is on par with something I&apos;d expect from him, but past that I can&apos;t see his influence over this film.

Granted the setting and the set production are exceptional, but that&apos;s really where the pros end. The acting, particularly by Guy Pearce who plays father to the main character, is abysmal. Next to him, Katie Holmes looks good. The pacing is way too slow, the CGI is bad, and the creatures look like something that with minimal tweaking could appear in a children&apos;s version of a scary movie. I wasn&apos;t impressed.

Gave it 45 minutes then just decided to call it quits. I won&apos;t be giving it another try. Not my type of horror movie at all.', 'reviewRating': {'worstRating': None, 'bestRating': None, 'ratingValue': None}}

{'author': 'DarkVulcan29', 'dateCreated': '2010-11-09', 'inLanguage': 'English', 'heading': 'If you are looking for believability, please try to remember this is a comedy.', 'reviewBody': 'The critics are being pretty harsh on this film, and yet they give high praise to such films like Role Models and Get Him to the Greek, so go figure. But I had a lot fun with Due Date, It was a fun slapstick misadventure, almost what we loved about The Hangover, so it is clear to say I don&apos;t agree with the critics on this one.

Peter(Robert Downey Jr) an architect looking to get home to his pregnant wife(Michelle Monaghan) who is expecting in a week. And when he gets on a plane, he quickly gets kicked off, when he gets into an unfortunate incident with Ethan(Zach Galifianakis) a pot smoking moron, and wanna be actor, who is obsessed with the show Two and a Half Men. When Peter is looking for new ways to get home. Ethan has a car and offers to drive him. Although it is against Peters better judgment, but feeling there is no other way, he goes with him. Will Peter make it on time for his child&apos;s birth, or will Ethan drive him nuts during this?

A lot of people said this is a Plane,Trains and Automobiles ripoff, but you know what who cares. This was a funny laugh out loud film. Downey and Galifianakis have funny chemistry, they just play off each other perfectly. Like The Hangover it is one entertaining misadventure, I say don&apos;t listen to the critics, see this movie and form your own opinion.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 8}}

{'author': 'tildiz149', 'dateCreated': '2023-04-01', 'inLanguage': 'English', 'heading': 'I wanted to like this more.', 'reviewBody': 'I was hoping for longer sex scenes, much more clarity and a few more flashbacks. I´m barely informed about Ninas and Janeks past! Why did they break up in the first place? Do they feel some kind of sexual tension that lasts very long? What future can Nina and Janek have? I must say that the script could have been better. Or was this movie loosely based on the script?

My dear parents have traveled to Iceland. They were happy with that journey. But what made Maciek go to Iceland? Business, pleasure, the gorgeous Icelandic nature or something else? Or was it just convenient for the attempt of the story lines development? If you ask me I would answer: the nature and yes.

All in all, this wasn´t the worst movie I´ve watched. It was tolerable, but not exceptionally great.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 6}}

{'author': 'kosmasp', 'dateCreated': '2019-10-28', 'inLanguage': 'English', 'heading': 'It ain&apos;t over til it&apos;s over', 'reviewBody': 'Lenny Kravitz knew best ... Music reference aside, this movie continues from where Breaking Bad left us. So suffice to say that this was made for fans of the show. And I will assume that you have seen the TV show, therefor do not read on, if you haven&apos;t.

The very last episode of Breaking Bad seemed to round things up. Almost all loose ends were tight up. Especially when it came to Walter White. And what was Breaking Bad if not a show about a teacher who became this bigger than life villain? Well Aaron Paul had something to say about that. And since his character had something to offer us still ... the creator of Breaking Bad felt he could satisfy the need from fans to have more.

And for fans the movie is filled with little pieces of callbacks and nice references. Not to mention some flashbacks with some of our favorite characters (to hate). So yes I do understand if some feel this undermines the end of the actual TV show, but that would be missing the bigger picture (no pun intended). Yes there was not an absolute need for this movie, but what it does is expanding on the ending and giving us something that transcends the TV show and may even elevate it - not to mention get many people to rewatch the original series ... even more so than Better call Saul made them do it (a show I haven&apos;t watched yet) ...', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 9}}

{'author': 'satksri-92208', 'dateCreated': '2023-05-30', 'inLanguage': 'English', 'heading': 'Sensitive, Beautiful & True to the core', 'reviewBody': 'A simple tale- of kids, their struggling parents, a sincere teacher, and of the harsh realities of a make shift rail-road community. The story is close to life and brings out the best in the characters, despite poverty and inequities of rural life. It captures the wonder and the joy of growing up with friends. Ikal, the child, is brought back to the school as if by fate, where he had all this amazing time; The school needs him. He also meets his childhood love - and effortlessly slips into his new role as a teacher - something he always wanted to do- inspired by his late teacher Ms Georgina.

The unique thing about the movie is- it captures childhood without any hype. It makes no contrived effort to lead the story to a good end. Above all, it inspires the viewer to see GOOD in people and circumstances.

Inspiring Movie.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 10}}

{'author': 'lesley_65', 'dateCreated': '2023-09-02', 'inLanguage': 'English', 'heading': 'Started well but petered out', 'reviewBody': 'This movie started out well with a tense and engaging scene in which a troubled young man (Artan) kidnaps his estranged wife (Louise) at work. The background to their estrangement is hinted at in this first scene and gradually revealed throughout the movie. The highlight is a dramatic and very entertaining encounter with Louise&apos;s parents in which much is exposed about the family dynamics. Unfortunately the movie doesn&apos;t sustain these heights and indeed I was losing interest by the end and feeling frustrated that so little was explained about Artan&apos;s back story.

If you&apos;re looking for a realistic, emotional family drama that feels like it&apos;s being played out in real time you&apos;ll probably enjoy this movie. However, if you&apos;re looking for a thriller or a psychological drama that keeps you guessing you&apos;ll probably be disappointed by the end.

The acting and photography are excellent throughout. Fares Fares is wonderful as the police negotiator with his usual understated, compassionate presence that any fan of the Department Q films will appreciate.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 6}}

{'author': 'estherechegollen', 'dateCreated': '2023-04-23', 'inLanguage': 'English', 'heading': 'A laughed so much', 'reviewBody': 'I laughed so much from the beginning to the end, all the actors were awesome I tell you I laugh so much it&apos;s a must see. I don&apos;t want to spoil the movie but you have to watch it. It is hilarious.. awesome job everybody! I had to put it in pause so I can finish laughing and continue watching.

A very good storytelling that it makes you think it can happen. It can be from a real story. The actresses they&apos;re so funny. And the chicken. Oh my gosh you have to watch it. It&apos;s hilarious.

It hurt me to see what happened to the convertible car because that&apos;s a really nice looking car. The kids actors. They did a great job too. So kudos to everybody.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 10}}

{'author': 'greasygirlgoneclean', 'dateCreated': '2022-06-25', 'inLanguage': 'English', 'heading': 'How is this rated so low?!', 'reviewBody': 'LOVED THIS! Such a sweet story, so uplifting, and fills you with hope.

Watched it with my 9 & 12 year old girls and we all fell in love with the story.

Great music, great movie! Highly UNDERRATED!', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 9}}

{'author': 'justasmisiuk', 'dateCreated': '2022-12-18', 'inLanguage': 'English', 'heading': 'Who cares that it&apos;s unrealistic', 'reviewBody': 'The movie was fun, although, a very Hallmark channel type of movie. C&apos;mon, a working girl meets a guy really into Christmas, never done before! (/s) And it was rather predictable, since the scene where Lisa&apos;s daughter (who&apos;s name I definitely remember /s) gets lost I pretty much predicted the whole movie. The acting was weak,certain parts were very corny, and (no offence), Lisa&apos;s eyes annoyed me.

Now&apos;s the part where i&apos;ll discard all of the problems and full-heartedly defend this movie! The idea is like many Hallmark Christmas movies, but more over the top. And people say that this movie is unrealistic and the idea is stupid, and for that I have one word: So? This is a Christmas movie for gods sake! Who the hell is going to sit here and critically judge a CHRISTMAS movie for crying out loud? The idea is fun and that&apos;s whats the only thing that matters in a Christmas movie. Christmas needs to be cheerful, heart-warming, not serious.

I rest my case.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'gunes-17052', 'dateCreated': '2023-03-10', 'inLanguage': 'English', 'heading': 'Excellent Movie', 'reviewBody': 'One of the best movies i have watched for a long time. I will certainly Watch it again to catch up the parts i have missed and to better figure the hidden messages and facts.

The movie brings several aspects of crimes together that can be observed in Turkey, as well as in all over the world. Really staggering to see so many bad people together in the same arena. My Congratulations goes to the author Mehmet Eroglu and to the staff who brought this story with very successful Artists into our screen. Also thank to Netflix for supporting film industry.

Looking forward to the next volumes of the Triology.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 10}}

{'author': 'olaarmyever', 'dateCreated': '2023-06-29', 'inLanguage': 'English', 'heading': 'Really underrated', 'reviewBody': 'This is one of the few things i watched without looking at the rating first and tbh I would&apos;ve not watch it with rating like this but im very glad i did For me this movie gives perspective to what goes into a relationship and how complicated and beautiful it is.

I was actually surprised it wasn&apos;t a cliche romance and unrealistic drama,it touched me I rewatched a couple of scenes from how good it was the actress did a phenomenal job and I appreciate how the time line is filmed you have to pay attention though you never know when its flash back or not sometimes.

You have to give it a shot it is worth it.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'kch-65793', 'dateCreated': '2020-12-25', 'inLanguage': 'English', 'heading': 'A Truly Wonderful Movie', 'reviewBody': 'It was Christmas Eve and I wanted to watch this movie and Cherry Magic. I put on the fire, made dinner and settled down to watch this film. I had to pause three times just to absorb just how raw and empathic this movie was to watch.

By the end, I was done. I couldn&apos;t manage to watch anything else. The narrative, the character development, the dialogue between the boy and the pastor, the realism and the cast are exceptional.

It&apos;s a movie that will communicate to many, that their experience and struggle through life, just to live in society, is understood and they&apos;re not alone. It reaches the soul.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 10}}

{'author': 'siderite', 'dateCreated': '2021-07-01', 'inLanguage': 'English', 'heading': 'If you don&apos;t know the series, this film makes no sense. Plus, it&apos;s kind of boring.', 'reviewBody': 'The difference between a series episode and a movie is that, even if they are connected, the film attempts to provide a standalone story that anyone can enjoy. If you are a fan of the series you will enjoy the parallel story and the hidden gems, if you are not you might like the film and try the series. Unfortunately, Hathaway is not that.

I don&apos;t enjoy Mechas that much and the only reason I watched this was that I thought some of the Mecha stories were good stories. I can&apos;t complain about the story too much, other than it was filled with hard to believe coincidences just in order to keep the same characters in focus, but without being familiar with the stories you won&apos;t get what this film was about. Characters pop up, complete with names and former connections to existing characters, and you are supposed to know who they are. The world is not developed at all. Everything stands on your ability to have seen, liked and remembered the preexisting content. And to top it off, there are two battles in total involving Mechas, one of them seen from the standpoint of civilians running around dodging debris.

The animation was good, without being exceptional, the acting was OK, but I didn&apos;t get anything out of the story, didn&apos;t empathise with any character and I do not feel the need so see what happens next. All in all it was pretty boring.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 6}}

{'author': 'Oberrated', 'dateCreated': '2016-10-20', 'inLanguage': 'English', 'heading': 'Superb acting, great story, fantastic chemistry', 'reviewBody': '&apos;Kiss Kiss Bang Bang&apos; was definitely a fun one to view. The team of RDJ, Val, and Michelle have a chemistry that works very well on screen and the story develops well as the run time continues, creating an ever changing engagement to the plot from the audiences&apos; perspective... Easily, Robert Downey Jr. is a fan favorite within the film. Viewing this movie for the first time while watching many other more recently released RDJ movies, it is clear to see how fantastic of an actor he is and how compelling he is as he demands attention with every word or action he projects. On the flip-side of things, he as the narrator made me laugh on multiple occasions... Comparing &apos;The Nice Guys&apos; to &apos;Kiss Kiss Bang Bang&apos;, this film easily beats &apos;The Nice Guys&apos; out in my book where I simply found this far more entertaining than it.

A very comedic and compelling film for your viewing pleasure. Fun from start to finish yet very clever and intelligent as well.

--Oberrated--', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'web-amazon-15964', 'dateCreated': '2021-07-31', 'inLanguage': 'English', 'heading': 'A very French Film', 'reviewBody': 'There are a lot of reviews denigrating this film, but I suspect that a lot of of this is down to cultural differences. This is typical French humour and it&apos;s refreshing to see van Damme play to it, which I think he is pretty good at.

Jackie Chan employs a lot of humour (and stunt doubles) in his films and gets away with it - and I think van Damme manages the same.

All in all, an amusing film and very French.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'samuel-a-spiers', 'dateCreated': '2014-10-23', 'inLanguage': 'English', 'heading': 'Snakes on a plane - Jesus edition', 'reviewBody': 'This was the worst movie I have ever seen. It is clearly destined to go straight to day time television. From the start the movies direction, plot, acting and music all give the impression of a day time drama but much much worse. 

I don&apos;t hate the premise of the movie, it&apos;s just like any other sci-fi fiction. However, this movie with it&apos;s bad acting and direction make it a complete and utter flop. Too much emphasis is placed on the religious aspects of this story making it feel like a veritable propaganda flick, ruining all chances of immersing in the story-line.

Do not waste your money on such a poorly produced movie. Religious or not, you will walk out of the theatre with nothing but regrets.', 'reviewRating': {'worstRating': None, 'bestRating': None, 'ratingValue': None}}

{'author': 'p-stepien', 'dateCreated': '2010-12-08', 'inLanguage': 'English', 'heading': 'Possessed by angels', 'reviewBody': 'The Angel Michael (Paul Bettany) plunges from heaven to Earth, after which he cuts off his wings and gets busy with gathering up an arsenal of weapons. In the meantime in an god-forsaken diner in the middle of New Mexico several lost travellers and the diner&apos;s employees surprisingly become a central point to the apocalypse. All because of the unborn baby of the diner&apos;s hapless waitress. Soon people possessed by angels appear and only Michael&apos;s arrival helps stave off the impending doom...

Even with the above basic premise it is easy to figure out where this movie is going. It that sense it is basically a homage to the brilliant Prophecy series (brilliant more in content than acting or direction). Now I must say that I am extremely surprised by the low grades the movie has on IMDb, given that so many worse movies have ratings in their 6s or 7s...

There are definitely things not right in this movie with the whole middle sequence surprisingly poor and borderline terrible in its lack of logic - possessed suddenly stop attacking and let the one thing they are preventing from happening happen... That said the acting was at least good and characters are well presented. Add to that a very good fight sequence with the angel Gabriel and I found this movie a good if uninspiring watch.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 6}}

{'author': 'Kjsaftner', 'dateCreated': '2020-03-14', 'inLanguage': 'English', 'heading': 'Better than it&apos;s current rating of 5.9', 'reviewBody': 'This is the first review I have ever written because this movie deserved more credit than it was given. It was not perfect and some of the acting was clunky, while others were exceptional. You really feel the mothers energy throughout and can grasp the love that truly was there despite all of their familial shortcomings.

 I am not sure how true this story was , but I hope the police were not this inept. I couldn&apos;t be sure if it was just over the top writing or not.

Overall, this was a good watch. Suspenseful with a decent enough cast.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'kosmasp', 'dateCreated': '2019-10-21', 'inLanguage': 'English', 'heading': 'Just the beginning', 'reviewBody': 'I watched the movie first and realized later this was just the first part of a possible trilogy. The second movie has not come out yet. I do like to watch a series back to back if possible and I probably would have waited, especially because I have a backlog of movies to watch anyway. But there is a hype surrounding this and I was curious to see it.

Now I do understand if some people think and say that at least 2/3 of the movie feel slow to them. Because the movie is taking its time. You can see that as a bad thing or a good thing, that depends on your viewing habits and how you like your movies to be. The movie does end with quite a highlight though. And I have to admit, the ending itself works like it is. Sure now that I know there is more, I want to watch that as soon as possible - which is going to be some time.

Acting is good, twists are nice if predictable I reckon and there will be blood. If that all sounds good to you to you can either watch now or wait at least until the first sequel arrives and do a double bill', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 8}}

{'author': 'rd-djunaedi', 'dateCreated': '2021-06-06', 'inLanguage': 'English', 'heading': 'All casts are great except Morgan Oey', 'reviewBody': 'This movie is hilarious and full of satire joke about the boss.. Silly yet entertaining.

However, like in every other movies, Morgan Oey has always been an annoying appearance with his poor acting. I think this movie would be better without him.

Nevertheless, overall it&apos;s still a great movie for the entire family to watch on the weekend.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 8}}

{'author': 'The_Geek_Spot', 'dateCreated': '2021-09-16', 'inLanguage': 'English', 'heading': 'Good to watch with the kids', 'reviewBody': 'A good horror movie to watch with the kids. It wasn&apos;t too scary nor too lame even for older children to sit down on and appreciate. For an adult alone, well that&apos;s the a whole different scenario as I was kinda bored in some parts, waiting for some real action to begin.

But the story and actors were altogether fun to watch. There was a uniqueness in the plot that will leave your kids in awe and would probably stay focused on the tv and not the snacks alone.

Kristen Ritter doesn&apos;t seem to have aged, suitable for her being a witch in this movie.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 6}}

{'author': 'Jeremy_Urquhart', 'dateCreated': '2021-04-16', 'inLanguage': 'English', 'heading': 'Unfortunately, this is quite bad', 'reviewBody': 'I feel like if you&apos;re into gaming this isn&apos;t going to tell you much you don&apos;t already know, and if you&apos;re not into gaming, you&apos;re probably going to find it boring and too scattershot to really get much information out of.

It jumps around so much- that&apos;s my main criticism. It bounces from one topic to the next with very little by way of segues or any sense of flow, and it&apos;s remarkably frustrating. It might be forgivable if more of the individual stories were interesting, because while some are decent, other segments are really boring.

While I appreciate the effort at presenting a somewhat global look at gaming throughout the world, maybe the broad focus was what led to it being so all over the place, unfocused, and ultimately unsatisfying. It could have just been too ambitious, and I think this particular type of documentary approach is far more suited to a miniseries, rather than a 90-something minute long documentary.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 4}}

{'author': 'hfsaidi', 'dateCreated': '2023-09-29', 'inLanguage': 'English', 'heading': 'A well-executed, tense survival thriller', 'reviewBody': 'This is indeed one of the best lost at sea movies I have seen in years. In fact, it should be in the same league as Cast Away. Through out its entire running time, I was almost on the edge of my seat. Anna Castillo&apos;s acting is prominently praiseworthy. Her rather natural acting has definitely won my heart.

The film has a fair share of tense, heart pounding, and many a time, breathtaking moments that are truly reflective of Albert Pinto&apos;s splendid directorial efforts.

Great direction, great acting, making it a great movie all in all! I&apos;m surprised why there&apos;s a lower rating than 7? Watch it... you&apos;ll thoroughly enjoy it!', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 9}}

{'author': 'mjkhail', 'dateCreated': '2017-06-29', 'inLanguage': 'English', 'heading': 'A netflix original that is worth your time', 'reviewBody': 'I wasn&apos;t expecting to like this very much, but I loved it.

There is no much to say about it but to give it a shot and enjoy it. 9/10.

It makes you think about many things, specially the treatment with have with animals and the relationship with our food consumption.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 9}}

{'author': 'Jaffa55', 'dateCreated': '2023-10-20', 'inLanguage': 'English', 'heading': 'Helps if you like Bill Burr', 'reviewBody': 'I suspect this film will get some bad reviews, particularly if you aren&apos;t familiar with Bill Burr&apos;s stand up or you find his style of comedy a bit much (Michael McIntyre he&apos;s not). Personally I&apos;m a big fan of Bill and the character he plays in this film is pretty much the one you get in his stand up shows.

The movie was written by Bill and that&apos;s evident straight from the start with the dialogue very much in his style and in line with his stand up contains several amusing scenes with middle aged men trying to understand the world of woke. However I felt the film lost some pacing and ran out of steam a little in the second half, as Bill&apos;s character makes the transition into something more acceptable to modern society.

Worth a watch if you like Bill. If you don&apos;t then maybe not.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 6}}

{'author': 'ahmetkozan', 'dateCreated': '2019-01-27', 'inLanguage': 'English', 'heading': 'Action & Brutality', 'reviewBody': 'First of all, the film shouldn&apos;t be a movie you&apos;ll definitely take seriously. Please leave your brain if you decide to watch this movie. Because this film is a crunchy film that focuses entirely on the action and the charm of ferocity. So there is no deeper meaning nor a deep scenario.

The visuals are great, the color palette is so good that even the nature looks modern. It looks like an Instagram filter has been applied to a picture taken with a proper camera. The girls are beautiful, the main character is charismatic, the bad character is a fat asshole. There are plenty of clichés. You can predict what&apos;s going to happen. Predicting what will happen is a problem in such films because it eliminates the thriller factor.

You don&apos;t have to pay much attention to, it&apos;s a fun movie. If you love action you can watch. 7/10', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'MissSimonetta', 'dateCreated': '2023-02-11', 'inLanguage': 'English', 'heading': 'I was actually moved by the existential crisis of this cartoon cat', 'reviewBody': 'CS Lewis once said a children&apos;s story that only appeals to children is not a good children&apos;s film in the least. I can think of plenty of crummy kids&apos; movies that illustrate the point, but I&apos;d rather bring up a positive example-- PUSS IN BOOTS: THE LAST WISH.

I cannot believe I am saying this about a Shrek spinoff, but this movie really is that good. It works on so many levels: as a high-speed comedy, all the jokes land, but as a story about mortality and the meaning of life, this film is oddly compelling and mature. The plot literally involves Puss running from the personification of death, hoping to cling to his life. In between the funny scenes, I was actually moved by the existential crisis of this cartoon cat. That&apos;s no small feat.

This is truly a movie kids and adults can cherish.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 8}}

{'author': 'Tweekums', 'dateCreated': '2023-04-18', 'inLanguage': 'English', 'heading': 'A solid religious horror film from Indonesia', 'reviewBody': 'This Indonesian horror film is set in a remote girls&apos; boarding school. New girl Yolanda is put under the guidance of Zahra, a senior girl with a good reputation who always obeys her teachers. It is clear that the girls are being raised as Muslims but there is something suspicious about their teacher. He instructs the girls to perform a ceremony to summon their Qorin Jinns... doppelgängers. They are wary but ultimately do as instructed. It isn&apos;t long before strange things start to occur. The teacher now has power over them and his intentions are far from righteous. The girls will have to be strong and hold firm to their faith if they are to defeat him.

This might not be the best horror film I&apos;ve seen but it was enjoyable. It had plenty of creepy moments and a few good scares. The story is effective even if, like me, you aren&apos;t familiar with the culture. While it may not be in the same class, the film this reminded me of most was &apos;The Exorcist&apos;. Like that classic the evil is confronted by religious faith and a willingness to risk all... there is even a scene where a girl does the famous &apos;spider walk&apos;! The cast does a solid job and the special effects are pretty good. On the down side things are a bit too dark at times making it hard to see what is going on. Overall a decent enough film that I&apos;d recommend to fans of religious horror films looking for something set somewhere different.

These comments are based on watching the film in Indonesian with English subtitles.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'ibob-63931', 'dateCreated': '2023-08-07', 'inLanguage': 'English', 'heading': 'Old story with commercial elements', 'reviewBody': 'Rangabali movie&apos;s narrative draws clear inspiration from the intricate web of local Andhra political rivalries that dominated the 90s. While this nostalgic nod might resonate with some viewers, the film leaves a few elements that merit consideration.

For families looking to enjoy a cinematic outing, it&apos;s worth noting that Rangabali might not be the best choice if you have kids in tow. The presence of explicit liplock scenes, item songs, and intense violence throughout the movie could potentially be unsettling for younger audiences.

In terms of storytelling, it&apos;s my hope that the creators of Rangabali venture beyond the confines of conventional narratives. The film seems to blend multiple plotlines, and while experimentation is commendable, it can sometimes lead to a disjointed viewing experience.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 1}}

{'author': 'kannibalcorpsegrinder', 'dateCreated': '2020-01-12', 'inLanguage': 'English', 'heading': 'Solid and highly emotional genre effort', 'reviewBody': 'Living in a remote Thai village, a woman who fears she may actually be the vicious creature responsible for the deadly attacks on local animals tries to hide her cursed condition from her friends who have taken up the hunt to stop it, eventually putting them both in dangerous situations.

There was quite a lot to like within the film. Part of the positives here comes from the decision to focus on a wholly undervalued aspect of the creatures&apos; legend by incorporating the cursed lineage origin story for the creature rather than the black magic route. That so few are aware that the true nature of the creature can be spread in that manner makes the storyline feel fresh and unique, especially with the build-up here to get the revelation about her real history. This is told in vivid dreams and flashbacks that contain the agony of being such a fearsome creature yet powerless to do anything about it as she slowly comes to be aware of her situation. That all makes the ensuing love triangle between her and the two guys feel impactful as the reassuring nature they provide rekindling the romance helps to ease her mind and forget the situation as they both truly care for her best interests once the secret is finally revealed. The romantic angle that emerges from that storyline setup is heartfelt and emotional, adding plenty of deep resonance to the horror that arises later on. On top of that, the film works incredibly well with the suspenseful stalking out in the local forest. From the opening game of hide-and-seek inside the abandoned building in the middle of the forest to the Krasue hunts the villagers partake in that are illuminated only by torches, the atmosphere is incredibly impressive and chilling and providing the early reasoning for the paranoia behind the villagers&apos; increasingly desperate need to find the creature responsible when added alongside the mounting animal corpses. The actual attack scenes themselves, with the actual separation of the head from the body being shown and following the floating head flying through the village and surrounding jungle with the red eyes glowing brightly against the darkened backdrop are especially eerie and chilling. As well, the encounter with the villagers looking to find the creature in the little girl showcases the fine mix of practical and CGI effects for the creature and adds more to like about this one. The biggest determining factor in the film will undoubtedly be the central romance. The idea of being able to love such a hideous, bloodsucking creature capable of dealing out the violence and terror on the villagers comes through rather strongly here, what with him shown feeding it dead birds and animals to keep her from attacking others or standing by each other&apos;s side despite the accusations from the other villagers to put her to death. Taking the finale into account as well, with the decision to stand up to the monstrous creature before him despite still being a simple human and then going away together to save each other from the villagers adds even more to the romantic sideplot throughout the film. Even looking at the race to cure her with the local medicine adds to the emotional impact of their relationship, bringing about an issue that might not be welcome for some who prefer more of a horror-based storyline. The sappiness from these scenes might turn viewers off as well as be seen as the reason why the film&apos;s as long as it is, especially with the constant slow-motion that drags these out to supposedly hammer home the weight behind the action. However, that is the only true flaw to be had with the film.

Rated Unrated/R: Graphic Violence and Language.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 10}}

{'author': 'Sleepin_Dragon', 'dateCreated': '2019-04-22', 'inLanguage': 'English', 'heading': 'Don&apos;t expect much.', 'reviewBody': 'It&apos;s fair to say that it is the worst of the series, it&apos;s let down by some really awful scenes, and some dire performances, but, it still has some of the old magic, and a few times I did find myself laughing. The scene between Sheen and Lohan was perhaps the worst thing I have ever seen, it was appalling, almost like an attempt to replicate the Pamela Anderson scene, but it was just terrible. The Black Swan scenes were lots of fun, and nicely produced, they felt at odds with lots of the film.

Is it the case that people&apos;s humour has changed since the early films, or were the jokes simply not funny? Personally I think it&apos;s the latter, in fairness though it isn&apos;t as if there were great horror movies to parody.

It&apos;s poor, but will still give the odd chuckle. 5/10', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 5}}

{'author': 'Kirpianuscus', 'dateCreated': '2022-12-28', 'inLanguage': 'English', 'heading': 'beautiful hommage', 'reviewBody': 'Homage to Roald Neame version of Scrooge, it is , for CGI more, a seductive animation inspired by the classic novel. And, sure imaginative at whole, reminding the good tastes of the fascinations specific to childhood.

I like Prudence , against the strange idea about a Scrooge as owner of a pet, I admire the scene about connection , in past, between Robert Cratchit and Ebenezer, like the inspired option for Jonathan Pryce for ghost of Jacob Marley, remembering the old beautiful work of Alec Guinness in the original version.

It is unfair to critic it . First, because it is a new demonstration of hard work with a not significant budget and about large possibilities offered by technology today. Second, because i am too old for critics. My favorit options are in the past . And this correct , imaginative, seductive Scrooge, like a noble hommage to work for 1970 Scrooge, has the beautiful virtue to remind, in fair manner,the splendid art of leslie bricusse.', 'reviewRating': {'worstRating': None, 'bestRating': None, 'ratingValue': None}}

{'author': 'keikoyoshikawa', 'dateCreated': '2021-03-24', 'inLanguage': 'English', 'heading': 'Shocking', 'reviewBody': 'I thought this documentary was going to be all about the crimes and unethical conducts by the fishing industry. Instead, the film-makers have also illuminated the various non-profits and advocacy groups that are contributing to the destruction of the oceans through their neglect, obfuscation, or - worse - complicity. And governments, too.

This is an eye-opener. And quite depressing at the same time. There doesn&apos;t seem to be any good answer or solution, short of reducing consumption. Which in itself doesn&apos;t seem to very feasible, given that for many people seafood is an important part of their diet, and global population continues to grow. :(

The only sliver of hope is perhaps plant-based seafood products. That, like lab-grown meats, for example, seems to be the only realistic way to achieve sustainability. But, as the film ends with, that depends on all of us making a choice.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 9}}

{'author': 'mdreser44', 'dateCreated': '2023-09-09', 'inLanguage': 'English', 'heading': 'Such a pleasure to see a healthy love story.', 'reviewBody': 'But also, it is a joy to see all the beautiful scenery of life in Turkey. The scenery chosen is very elegant.

Many people may think it too light-hearted, but I saw a depth in it that might not be obvious to some. For example, there is more respect for romance, and more depth in their relationship. A seriousness in their romantic decisionS, not shallowness.

I did ponder at times (because I&apos;m fond of philosophizing) why it offered such a &apos;European&apos; view of relations, rather than an Islamic perspective that represents 98% of the people. But I certainly didn&apos;t complain. It is a genteel story and we enjoyed it thoroughly!', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'msunando', 'dateCreated': '2020-10-08', 'inLanguage': 'English', 'heading': 'Genius, manipulative, smooth, or plain fraud?', 'reviewBody': 'Ayyan Mani (Nawazuddin Siddiqui) is an ordinary man, leading an ordinary life. Professionally, he is the PA to Dr. Acharya (Nasser) the lead scientist at NIFR and is absolutely convinced that his boss is fooling the world with his wacky research on alien microbes but puzzled about how convincing and confident the latter is, in getting away with lies. With the birth of Mani&apos;s son Adi, he hatches a grand plot of exhibiting his slow learner kid to the world as a prodigy and a genius in the making, thus achieving the extraordinary aspiration of societal recognition and adulation.

Adi grows confident due to Mani&apos;s incessant guidance, illegitimate mechanisms for catapulting him to fame and popularity, using which the latter gains the recognition that he otherwise would never have achieved. It&apos;s a grand secret between the father and the son, but like all good things, it must come to an end. The repressed childhood of Adi, and his inability to act without assistance slowly starts getting to the child, something that can potentially destroy him mentally. Mani has to find an exit strategy to ensure the safety and wellbeing of Adi, and is ready to pay the price for it.

Serious Men, directed by Sudhir Mishra is a tale of a twisted mind that refuses to succumb to the ordinary and will go to any length to realize his dreams, by hook or by crook. Nawazuddin Siddiqui is par excellence as the master manipulator, who is least concerned about the lack of maturity of the young mind, piling on agony on the child with psychological overload. But Serious Men belongs to the child artist Akshath Das, who absolutely captivates with his charm, innocence and complex psychological emotional demonstration, especially when he is unable to handle the burden any longer. Serious Men is a diabolical essay that waltzes on the screen in the garb of a socio-comic drama that gradually returns the young mind to sanity and normalcy, but not without collateral damages. It does leave some important messages for parents who overload their children to rise to the competitive world, without being preachy.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 8}}

{'author': 'SoumikBanerjee1996', 'dateCreated': '2023-03-14', 'inLanguage': 'English', 'heading': 'The final act messes things up!', 'reviewBody': 'Even if this is a work of fiction, the things and the messages it sought to convey here show just a small portion of the terrifying reality we cannot afford to overlook!

This movie tries to educate us about that issue while presenting a relatable piece of narrative that could happen to anyone, which is the most frightening aspect of the film. In todays modern world of digital dependency, we prevalently underestimate the factor of anonymity and that could bring a slew of problems. One mistake can bring inconceivable repercussions.

Now, merely evaluating it from a cinematic point of view, it was just passable; neither great nor horrible! The first two acts are excellent because they happen to construct a tense, suspenseful buildup, but when the third act gets underway, everything falls apart. I&apos;m not certain as to what exactly went wrong, but they were just not able to maintain the momentum or the true essence of the tale.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 6}}

{'author': 'MadamWarden', 'dateCreated': '2021-02-15', 'inLanguage': 'English', 'heading': 'SPACE WEEPY', 'reviewBody': 'Great fun space fantasy that tugs at the heart strings (well it tries to). Cheesy but great fun. Great characters, solid CGI and fair plot.

Not to be taken seriously but good escapist entertainment.

Well done Netflix.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'Re1nard', 'dateCreated': '2019-02-04', 'inLanguage': 'English', 'heading': 'Below My Expectations!', 'reviewBody': 'I watch this movie simply because the original series are my favourite. Apparently, I have put my expectations too high for this one.

The story has too many loopholes. The actors and actresses have passed their prime performances. Mandra is more irritating than looking funny. The jokes are no longer funny. Doel himself is dumber than ever. Simply look stupid as a mature man.

In a nutshell, the entertaining factors from this movie have disappeared. Watch it just for the sake of being nostalgic. That&apos;s all.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 6}}

{'author': 'lastjosh', 'dateCreated': '2018-05-31', 'inLanguage': 'English', 'heading': 'For anyone who feels discouraged by the reviews', 'reviewBody': 'For anyone who feels discouraged by the reviews, I tell you this: They&apos;re not complaining about the movie, they&apos;re complaining because they feel abused by a continous stream of movies from a beloved franchise. It seems ironic, I know, but having nothing for so long and suddenly watching different posters every six months, has to be confusing and bound to raise some eyebrows. However, we have to look at it as objectively and simple as possible: If you love movies, you want to watch as many movies as you can. And if you love Star Wars, you love to experience the Star Wars&apos; story! So all of this backlash for having so much of the thing you love is simply a tantrum that I hate to see on so many of my fellow Star Wars&apos; fans.

This a very well made film that anyone can enjoy. Plot, acting, FX, Photography, Cast, etc. They did a great job with everything. Taking into account the enourmous pressure of making a film from such a historical franchise, I take my hat off for anyone who has the bravery to do this.

So, go and watch it, not with skepticisim, but with that natural feeling of curiousity and love you have every time you sit at the movie theater. I promise, you&apos;ll be pleased.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 9}}

{'author': 'rodrickEle', 'dateCreated': '2018-07-11', 'inLanguage': 'English', 'heading': 'A delightful and touching tale about parenthood', 'reviewBody': 'I just discovered Koreeda&apos;s films and I&apos;m surprised, and angry with myself, I didn&apos;t know about this great director and storyteller. The film is a wonderful story about parenthood in which its hardship and beauty are well balanced.

The story drives the audience into the lives of two (almost antagonistic) families who had to go through a tough situation together, a situation imposed by a third party in the past. Koreeda tell us the story by examining these two very different families. By portraying these almost antagonistic families the story creates contrast and allow the characters to grow an evolution while they discovered themselves. 

I will not say more... watch it if you are looking for touching, delightful and well directed story about family and love.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 8}}

{'author': 'intelearts', 'dateCreated': '2011-07-13', 'inLanguage': 'English', 'heading': '439th Review: Good inspirational sports movie especially for teens', 'reviewBody': 'Soul Surfer is a good inspirational true story sports movie with some faith elements (Nothing too serious there, just emphasizing it was important) that hits all the right targets. As with any true story it is slightly linear, but that minor gripe aside, it is moving, and fun, and inspiring and that surely is the point.

At its best in the surf the story of Bethany Hamilton who lost her arm in a shark attack but by sheer determination went on to become a professional surfer is made to inspire and the film doesn&apos;t disappoint. 

All in all, this is a good family movie with solid acting and some terrific surf scenes that should inspire everyone.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'mandorallen-the-lion', 'dateCreated': '2020-03-06', 'inLanguage': 'English', 'heading': 'Good flick', 'reviewBody': 'If you&apos;re taking this more seriously than that you weren&apos;t paying attention. There&apos;s not a moment in this movie where they submitted any requests for you to think higher of this than a fun flick. Try judging it on that.

It was fun. For fans of die hard and such. Was it dark and depressing like many crime drama&apos;s? no. Was it stupid like most comedy crime dramas? no. Was it boring like most everything else? no.

Fun characters, with great people acting them, obviously. Alan arkin for god&apos;s sake. (but she stole the cake if we&apos;re honest) Plot was never slow. Setting is always engaging. Boston is just fun . . .', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 6}}

{'author': 'jrneptune', 'dateCreated': '2018-10-29', 'inLanguage': 'English', 'heading': 'Predictable and cliched but worth the watch', 'reviewBody': 'Jtncsmistad provided a great review. Please do take a look at it.

To add my thoughts I am a fan of Tucci, Sedgwick, and Garofalo. The first half of the movie held my interest and I thought they all gave great performances but the second half of the movie unfortunately was very predictable. I don&apos;t mind predictable with an interesting story but in this case even great acting did not save the story.

Worth a watch and definitely watch if you are a teacher.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 6}}

{'author': 'glennaa11', 'dateCreated': '2012-12-16', 'inLanguage': 'English', 'heading': 'Way better than I was expecting', 'reviewBody': 'The other reviews do a good job telling you the plot. I had seen the soundtrack for this film several times in the Thai record stores and was intrigued by the track list and artists who were involved. Otherwise I didn&apos;t know anything at all about the film. The album cover made me suspect it was a dumb teen comedy. But when I saw it listed in Thai Airways&apos; AVOD system on a recent flight I decided to check it out. And I was very pleasantly surprised.

Far from being a dumb comedy (although there are plenty of funny moments) it&apos;s really one of those unrequited love triangles. And I love those kinds of films. I&apos;m not ashamed to admit I shed more than a few tears. The acting is excellent, especially Ped. I imagine that for an actor playing that type of withdrawn, shy character must be a real challenge. And while the relationship between Ped and Ern seems to be the center, it&apos;s really the relationship between the boys, Ped and Koong that is what holds the film together. Their break up and reunion had a palpable realness to it that really hit me. Poor Ped just can&apos;t figure out how to ask for what he wants or needs from anyone. So he is a bit isolated. You feel really sad for him when he loses the girl and the boy.

The music is great. And I also enjoyed the cameos from the music stars. Definitely worth checking out!', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 8}}

{'author': 'imseeg', 'dateCreated': '2020-02-23', 'inLanguage': 'English', 'heading': 'It&apos;s not my cup of tea, but it&apos;s definitely stretching the boundaries of comedy and drama. Or better put: it&apos;s totally weird and gross, but in an original way.', 'reviewBody': 'I didnt like it, but it has it&apos;s perks: it&apos;s definitely original, daring, weird and fascinating (up to a point, for me at least).

The story: Paul Dano is stranded on a deserted island and wants to kill himself. Just at that very moment Daniel Radcliffe washes ashore. They become best buddies in the most unique way possible. Seeing is believing.

For whom might this movie be interesting? For die hard art house fans of bizarre (really weird) drama comedies. Potter fans better move along...', 'reviewRating': {'worstRating': None, 'bestRating': None, 'ratingValue': None}}

{'author': 'ReganRebecca', 'dateCreated': '2017-09-29', 'inLanguage': 'English', 'heading': 'A heartbreaking look at an American as segregated as ever', 'reviewBody': 'Teach Us All is timed with the 60th anniversary of the Little Rock nine desegregating a school in Little Rock. For those not up on their history the film begins with this mini history lesson, explaining why this act of desegregation was so essential. 

The film covers a pretty depressing subject, the fact that American schools have become as segregated as they were before the mass desegregation efforts of the civil rights movements in the 60s. In a series of talking heads the film interview activists, students and teachers. It&apos;s well constructed and easy to watch and covers a lot of ground. 

The documentary is made pretty conventionally, a series of talking heads. Still, it&apos;s worth watching as an introduction to the education crisis.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 6}}

{'author': 'filmbuff1974', 'dateCreated': '2006-11-22', 'inLanguage': 'English', 'heading': 'Outstanding!', 'reviewBody': 'I saw this movie on a fluke.I was standing on 42nd street waiting for a bus to go home and a sister started passing out free tickets for a preview of this movie.I gave it a chance not expecting much.The promotional movie posters I&apos;ve seen on the subway station walls do not give this film justice at all.

The movie is about a young rocker who goes on a journey to learn the craft and art of heavy metal.I&apos;ll leave it there.The movie is a heavy comedy and lot&apos;s of fun.If your are old enough to remember when Heavy Metal dominated the music scene in the eighties you are going to love this film.Jack Black is an amazingly talented comedian and actor and assuming he really wrote and performed the songs in this film he is also a talented musician.

Tenacious D is definitely worth a look!', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 10}}

{'author': 'Ric-7', 'dateCreated': '2010-09-15', 'inLanguage': 'English', 'heading': 'A victim of bad marketing', 'reviewBody': 'As an action thriller, I&apos;d give this film maybe a 2/10. But that is not what it was intended to be. The ads and marketing of the film falsely suggest this is an action film, and that is a great disservice both to the film and to the audience. I suspect that the film&apos;s rating would be higher had the marketing been honest. It is almost the opposite of action: it&apos;s a quiet, introspective film. I didn&apos;t expect a thriller and so I wasn&apos;t disappointed.

As usual in this kind of film, there is not a lot of backstory. We never find out exactly where Jack came from, how he found his job, why he could take such a job, etc. But that&apos;s not really the point. We never really find out much about the back story on the other characters, either. I think we actually found out more about the priest.

I enjoyed the film in about the same way I would enjoy a short story, which focuses on a few points rather than furnishing a history and full explanation.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 8}}

{'author': 'portmanrobson', 'dateCreated': '2018-10-12', 'inLanguage': 'English', 'heading': 'The Dark & Crazy Side of the Wild West', 'reviewBody': 'This is a fantastic movie - beautifully shot and acted showing the dark and bleakly funny side of the lawless Wild West. If you love the Coen Bros (who doesn&apos;t?) then you&apos;ll love this.

The movie is made up of six different stories - so you get 6 for the price of 1!

Highly recommend.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 9}}

{'author': 'Empifilmes', 'dateCreated': '2022-06-10', 'inLanguage': 'English', 'heading': 'Surprising!', 'reviewBody': 'This movie exceeded my expectations. Judging by the Cast I thought it would be just another comedian romance. Turned out I was wrong. I&apos;m not saying the movie is great, but it hits differently than the rest. Unlike most of its genre, it is unpredictable and moving, as the massage the film is trying to transmit is important. Through comedy, emotion and expectation, the film manages to take you on a ride of emotions and laughs that really is a war of genres.

Of course the story has problems and some things don&apos;t make sense but I think it&apos;s ok because I don&apos;t look for such things in these kind of movies.

If you want to spend a good hour and a half I recommend you watch it because it will keep you entertained the entire time.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 6}}

{'author': 'Sleepin_Dragon', 'dateCreated': '2018-02-05', 'inLanguage': 'English', 'heading': 'Never mind that thing at the end, where was the plot!!', 'reviewBody': 'I don&apos;t like to slate films as a rule, but this was not good. The positives, the acting was ok, some nice special effects, and initially a good premise, the Earth disappearing, which in turn created some nice tension. The whole thing instantly fell apart due to the absence of any plot, I understand the whole Cloverfield premise, of nothing is supposed to make any sense until the whole thing is pieced together, but lazy writing does not make up for ambiguity. The trailers were brilliant, and instantly made me watch the film, just goes to show how powerful a trailer can be, and how bad the actual film is. The characters were presented in such a way that I had no empathy for any of them, on the whole they were unlikable. 

It&apos;s no wonder this went straight to Netflix.

3/10', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 3}}

{'author': 'planktonrules', 'dateCreated': '2017-10-26', 'inLanguage': 'English', 'heading': 'A rather amazing film.', 'reviewBody': 'Justin Benson and Aaron Moorhead wanted to make a film. The problem is that they&apos;re newcomers to filmmaking and didn&apos;t have the millions it usually costs to make a movie. So, they chose to star in the film, direct, produce and Benson wrote the script! In addition, although the film has some sci-fi/supernatural elements, they managed to create some stunning special effects on the cheap! Watching it is like a lesson on economical filmmaking...and it&apos;s a darned good film to boot!

Justin and Aaron (yes, the filmmakers use their real names) both apparently left a cult many years ago. Unfortunately, their lives have sucked since and not Aaron is growing wistful and wants to return to this cult for at least a visit. Exasperated, his brother eventually agrees to make the drive to the middle of no where. And, not surprisingly Aaron LOVES the place and wants to stay. Justin, on the other hand, soon learns more about the place and is scared to death...as Aaron eventually will be as well.

I would try to explain more about the plot but it&apos;s almost impossible to describe the plot. Instead, just watch it with an open mind and enjoy the high quality of the production. It&apos;s also a film with a few funny moments as well as harrowing ones...and a film that I am very happy I saw at the Philadelphia Film Festival.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 8}}

{'author': 'earthblue', 'dateCreated': '2018-10-18', 'inLanguage': 'English', 'heading': 'Pleasantly Surprised', 'reviewBody': 'This German Axis/Allies love story is above and beyond better than Suite Francaise (2014) where Matthias Schoenaerts was such a bore in that movie. The Exception is in league with the heartbreaking Le Silence de la Mer (2004).

When I found out that Jai Courtney was cast as Brandt I was so against it since I found Jai bland/miscast in his previous films, excluding Suicide Squad where his Captain Boomerang&apos;s entertaining in that. But Jai won me over with his Captain Brandt and he shares a nice chemistry with Lily James. I loved their eventual love story. Plummer and McTeer were good in this too and shared a nice/sweet moment towards the end that had me teary-eyed.

Overall I enjoyed this movie; it had me glued in from the 2nd act until the end.', 'reviewRating': {'worstRating': None, 'bestRating': None, 'ratingValue': None}}

{'author': 'latinfineart', 'dateCreated': '2017-10-20', 'inLanguage': 'English', 'heading': 'A brilliant character study, that blends a powerful story with great humor', 'reviewBody': 'I really liked this film, as unorthodox as it was. The first hour was uproariously funny, before becoming a deep, and poignant study of the millions of lives of Americans who are living on the fringes of society, just barely surviving day to day. There is a shocking lack of cinema devoted to this underclass, and seeing this small film, was refreshing, enlightening, and surprising, and a refreshing contrast to the plutocracy we see all around us today. 

The performances were outstanding. I am not sure where Bria Vinaite has been hiding, but she was astonishing as the mom, Hailey. Her daughter and all of the other kids were great, and their interactions, behavior, dialogue and play was hysterical. Then it kind of morphed into a more serious story, that was credible, and powerful. Willem Dafoe was his usual masterful self, and played a very real, very likable guy. A tough guy with a heart of gold. 

I highly recommend this film. Not for everyone. Several people walked out during the film. My presumption was that they either thought the film focused too much time on the kids, or they were living in a state of denial, like so many Americans these days, pretending that this huge underclass does not exist. Regardless, it felt like a story that needed to be told. And it was told very well. Kudos to the filmmakers.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 9}}

{'author': 'Malamut', 'dateCreated': '2013-08-23', 'inLanguage': 'English', 'heading': 'A chilling realistic serial-killer movie', 'reviewBody': 'I have been interested in serial killers for some time now and I am familiar with the real story upon which the movie is based. 

Although Cage and Cusack have starred in some sub par movies over the last few years, they are both quite talented and give excellent performances in this effort. However, the real star of the film, perhaps somewhat surprisingly, is Hudgens, who makes her character look very real and believable. 

Although the plot has been heavily misused in other films in the past and is not in itself very original, this is not your typical serial- killer movie. The movie manages to be compelling without going over the top with too much gory details. The atmosphere it creates is very authentic - it really takes you back 30 years ago in Alaska, when these gruesome events unfolded.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'Rachelle8765', 'dateCreated': '2022-11-24', 'inLanguage': 'English', 'heading': 'A very pleasant surprise', 'reviewBody': 'I was binging some cheesy Christmas movies and I saw this and I thought ok sounds like another typical 4, 5 average I&apos;ll pass the time.

I was surprised, it was a really very nice movie. I even shed a tear there at the end.

I really liked it. Great movie, great acting. It touches on so many painful subjects but not in a heavy way. The actors are all great, nothing cheesy and it does have a Christmas vibe to it. Ok well maybe a few scenes were slightly cheesy but the rest is really good and sad , that I was really thrilled and smiled at those cheesy moments. I finished the movie having a lot of thoughts about my own life and the people in it, so relatable. Definitely not what i expected feeling after a Christmas movie.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'tim_a_jay', 'dateCreated': '2004-07-31', 'inLanguage': 'English', 'heading': 'Sentimental favourite', 'reviewBody': 'I just finished watching the Saint again, it&apos;s the sort of movie you remember seeing a few years back and when you get home after a long day at work your glad it&apos;s being re-run on TV. The plot is nothing stunning but neither is it entirely unbelievable. Simon Templar (Val Kilmer) is a big time con-artist/thief who operates to further his own financial position, charm some very attractive ladies and buy himself a Volvo that actually looks good. An ambitious Russian oil magnate hires him to steal a formula off a gorgeous nuclear physicist. They fall in love and Templar turns from thief into hero. I don&apos;t think this movie claims to be anything life-changing but it&apos;s good fun if taken lightly. Kilmer has a good turn as Templar and his various disguises and pranks along with some bungling by a few hapless Scotland Yard detectives provide a few laughs. The action is great fun and backed by the Chemical Brothers and Underworld. The romance between Elisabeth Shue&apos;s character and Kilmer&apos;s isn&apos;t bad either, they&apos;re both convincing in their own way and there are some nice moments for sentimental folk like me. The Saint is perfect for a quiet night with the boys, beers and some gawking at Elisabeth Shue, it&apos;s bad not to watch with that someone special either.

Cheers

Tim', 'reviewRating': {'worstRating': None, 'bestRating': None, 'ratingValue': None}}

{'author': 'Leofwine_draca', 'dateCreated': '2014-02-22', 'inLanguage': 'English', 'heading': 'A big surprise', 'reviewBody': 'I&apos;d put off watching THE SOCIAL NETWORK for a time, suspecting it to be a dry and slow-moving film. After all, it was about the guy who founded Facebook, so how much fun could it be? I didn&apos;t much like the idea of watching a film based around people sitting on computers, so I was in no hurry to see it.

Now I&apos;ve watched it, and things have changed. Because THE SOCIAL NETWORK turns out to be one of David Fincher&apos;s best films, and that&apos;s from a director whose filmography is littered with gems. This is a hugely entertaining and thoroughly gripping story of success, defeat, lies and deceit, and I was so caught up in the narrative that the two hour running time flew past.

The joy of THE SOCIAL NETWORK is that it focuses on the conflict between the various parties involved with the founding of one of the world&apos;s most popular websites. It&apos;s bam, bam, bam, with barely time to breathe, let alone get bored. Good performances are given across the board, particularly from Jesse Eisenberg and Andrew Garfield, two actors I&apos;m normally disposed to dislike, both of whom are excellent. Technical values are, unsurprisingly, absolutely spectacular, and it&apos;s clear that Fincher is in his element, making a mini-masterpiece out of the premise. Splendid stuff.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 9}}

{'author': 'kanishk-hk', 'dateCreated': '2010-07-06', 'inLanguage': 'English', 'heading': 'Complete movie was predictable ....and Kristen&apos;s acting sucks', 'reviewBody': 'movie was full predictable, you can tell the end after 30 min of viewing. i watched it at night and literally i was about to sleep ... i was hoping to see some good vampire/werewolf vs. vampire fight in the end but all i got was max. 15 secs of crap (trailer almost have all the imp scenes).

and most SUCKing thing in the movie was Kristen Stewart&apos;s acting, her face remain emotionless in the entire movie ... widening eyes and opening mouth cant make you a good actor.

WATCH TRAILER INSTEAD OF MOVIE .... its free and you can have more fun because they have added all the thrilling action in trailer.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 5}}

{'author': 'flyingsaucer', 'dateCreated': '2009-06-02', 'inLanguage': 'English', 'heading': 'A Heart touching Movie', 'reviewBody': 'There are some movies which make you smile and cry at the same time(I didn&apos;t cry). This movie is that sort of movie.

The movie starts with an old man telling the old legend of Water Horse to a couple. The story relates to a boy, who lives with his mother and sister. The military just takes over their house during the war time, and the family is forced to live with them. This boy finds a small shining stone and brings it to his house and in the morning after the stone was brought, the stone is not there, instead there are pieces of it, and there in that room a small creature is present. This is the Water Horse. The child takes care of it without raising the suspicions of his mother, but the creature grows so huge in so small time that he is forced to drop it back in the ocean.

The relationship between the creature and boy is shown well in the movie, covering all the emotional angles with panache. The direction is consistent. Although it may not blow your mind with excitement, it is a calm movie which makes one think of the nature of man. I would recommend it.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'sareed1971', 'dateCreated': '2021-04-09', 'inLanguage': 'English', 'heading': 'Stop green lighting every single thing by Falcone/McCarthy', 'reviewBody': 'While Melissa McCarthy can be funny (I enjoyed The Heat and Spy), it&apos;s obvious no matter the studio, everything McCarthy and her husband, Ben Falcone, offer up is immediately greenlit. That has to stop. This is the umpeeth unfunny movie by the married duo.

After the first 30 minutes, I simply had the movie on in the background, but could still hear McCarthy&apos;s ad-libs which were excruciatingly awful.

If this is the best an immensely talented actress like Octavia Spencer has to pick from, that&apos;s a sad commentary on the state of comedic films. Let&apos;s hope she got a big, upfront payday.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 2}}

{'author': 'peter07', 'dateCreated': '2020-04-13', 'inLanguage': 'English', 'heading': 'Perhaps a bit short but still a good film', 'reviewBody': 'I watched this on Netflix, and the premise was very interesting. A man leaves the love of his love in Taiwan for the chance of immigrating to America with his boss&apos;s daughter, and he decides to seek the love he left behind as an old man as well as get along with his estranged daughter.

Though the narrative was interesting, well, I felt that the film could&apos;ve done more with the characters, esp. Yuan, who is played by veteran actress Joan Chen. I think she should&apos;ve had more screen time given her acting prowess, and perhaps this could&apos;ve been a limited series. Maybe I&apos;m insisting on what the movie should&apos;ve been instead of accepting what it was, but by the time it ended, I was sorta left hanging.

Still, this type of tale should be told more often. As the parents of Asian immigrants myself, it struck a chord with me.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'Michael_Elliott', 'dateCreated': '2016-09-28', 'inLanguage': 'English', 'heading': 'Another Bizarre One', 'reviewBody': 'Tootsies in Autumn (1963) 

* 1/2 (out of 4)

Mike Kuchar directed this ten-minute short about a group of stage actors who are fighting. The main draw to this film will be the early acting appearance by George Kuchar. If you&apos;re familiar with the brother&apos;s work then you already know that they made some pretty strange films. This film here certainly isn&apos;t entertaining but at the same time it&apos;s just so weird that you can&apos;t help but keep watching and wondering what&apos;s going to happen next. I&apos;m going to guess this was just meant to show some laughs at the expense of a fighting crew but it just never connected with me and in the end it left me pretty bored.', 'reviewRating': {'worstRating': None, 'bestRating': None, 'ratingValue': None}}

{'author': 'Michael-96', 'dateCreated': '2013-06-29', 'inLanguage': 'English', 'heading': 'A lot of (mostly) innocent fun', 'reviewBody': 'I was lucky to see Turbo at a preview today, and had a great time. I don&apos;t want to give anything away, but suffice to say that I greatly enjoyed the movie. The plot&apos;s cute, the characters amusing, and there are some hilarious one liners. (As well as a few somewhat more risqué jokes for the adults, although they&apos;ll fly over most kids&apos; heads.)

It&apos;s not going to rival Pixar at their best, but it&apos;s a lot of fun. I will say, though, that this isn&apos;t a film I&apos;d bother with 3D for. It takes a back seat, and is little more than a gimmick. You won&apos;t be missing anything at all to watch in 2D.

But other than that, heartily recommended!', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'vicanderson-65111', 'dateCreated': '2022-03-11', 'inLanguage': 'English', 'heading': 'Slightly cringey but what 13 year old girl isn&apos;t?!', 'reviewBody': 'There&apos;s a reason this movie is a PG and not a U! Everyone having a little turn because a 13 year old girl is given some maxi pads and has crushes on boys - it&apos;s not woke, it&apos;s reality.

And if you have a problem with characters wearing turbans/hijabs, then I really think you need to look deep inside yourself!

This movie doesn&apos;t feel like a Disney/Pixar because it&apos;s cringey and has anime elements - but it&apos;s still fun, and my 10 and 8 year old boys had no problem at all with seeing sanitary protection because guess what, they see it in our bathroom every day!', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'masonsaul', 'dateCreated': '2023-03-04', 'inLanguage': 'English', 'heading': 'Really fun 80s throwback', 'reviewBody': 'It&apos;s overly long and goes to some very random places narratively but We Have a Ghost is still a really fun 80s Amblin throwback that has plenty of charming moments and humour that hits more than it misses. It&apos;s definitely Christopher Landon&apos;s weakest film in a while but thankfully still isn&apos;t bad by any means.

The cast are all good in their undemanding roles that require them to go through the usual stereotypes and motions and David Harbour is obviously the standout with the hardest job. He has to be extremely innocent and emotive purely through movement and he pulls it off effortlessly.

Christopher Landon&apos;s direction is really good, the film has some fun set pieces combined with the right songs to make them even better and the overall earnesty of the film wins you over by the end. The CG isn&apos;t anything spectacular but it&apos;s convincing enough and rarely pushes its own limitations.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}

{'author': 'Top_Dawg_Critic', 'dateCreated': '2019-07-25', 'inLanguage': 'English', 'heading': 'An all-around great martial arts Chinese production!', 'reviewBody': 'A lot of mixed reviews on here, too much/not enough fighting/story. Comparing this to IP Man series is just dumb.

I liked the (an actual) story-line, the pacing was great and the length on point. Fight&apos;s/choreography was very well done. Directing was decent and cinematography on point. I liked the location sets. The score was a little overbearing. It was great to see Dave Bautista and what little we saw of Tony Jaa. All cast performed great but I was a little disappointed with Jin Zhang... his constant same facial expression was annoying.

Nevertheless, and excellent martial arts flick with a good story and great action scenes that I thoroughly enjoyed! It&apos;s an 8/10 from me.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 8}}

{'author': 'Top_Dawg_Critic', 'dateCreated': '2022-07-04', 'inLanguage': 'English', 'heading': 'This Ip man film proves why directing makes all the difference.', 'reviewBody': 'One reviewer stated that it slaps Donnie Yen in the face; I didn&apos;t really mind that they cast Tse Miu (who oddly is not listed in the casting) to play Yen&apos;s character at a young age, his acting was actually decent. But the problem wasn&apos;t that Yen wasn&apos;t cast, it&apos;s that it lacked Wilson Yip&apos;s directorial magic, and Edmond Wong&apos;s creative writing - both of whom did all the previous Ip Man films (I&apos;ve seen them all) that made me a fan of the franchise. The real slap in the face goes to those two, because it&apos;s evident this film was missing their magical touches, especially the fight scenes.

Here, you have two directors in this one - Li Xi Jie and Zhang Zhu Lin, and Fang Lan and Liu Bayin as writers, who instead gave us 1980&apos;s slow-mo cheesy and sappy scenes. Some of the choreography, especially at the beginning, was just as bad as the writing and directing.

Although the cinematography was up to par as the previous films, and the actual story had its merits, the rest of the production was a let-down of my expectations. Would I recommend this one? Well, if you&apos;re a fan of the franchise, it&apos;s a decent (but not great) origin story, so I&apos;d say yes. But don&apos;t have high expectations like I did, as this production if far from the greatness we&apos;d expect from Yip and Wong. Hopefully this mess inspires them to give up a better origin film. Sadly, it&apos;s a generous 6/10 from me, most going to the cast who I&apos;m sure tried their best with what they were given.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 6}}

{'author': 'cardsrock', 'dateCreated': '2023-02-09', 'inLanguage': 'English', 'heading': 'Astonishingly annoying', 'reviewBody': 'It&apos;s been some time that I&apos;ve been so bewildered and frustrated watching a film.

This very talented cast is absolutely wasted on a terrible script filled with inane and outdated jokes. It&apos;s 2023, I think we&apos;ve moved beyond the ridiculous viewpoints and stereotypes displayed in this film. The characters behave in such ridiculous ways. Eddie Murphy suddenly just decides to stop being a racist piece of crap and Julia Louis-Dreyfus has an awakening about how to speak to black people normally. It&apos;s all just so freaking annoying to watch.

Hill and London also have net zero chemistry between them, which funny enough, really tends to tank a romantic comedy.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 4}}

{'author': 'bryonyb-75948', 'dateCreated': '2022-12-17', 'inLanguage': 'English', 'heading': 'A Fun Light-Hearted Rom-com', 'reviewBody': 'A fun light-hearted romantic comedy movie from Turkey. It&apos;s not to be taken too seriously.

The acting is not brilliant, but it&apos;s not bad either. The storyline is cute about a beautiful girl named Azra ( Bensu Soral from Icerde) who takes up private lessons with girls who wish to improve themselves and win the hearts of men. She helps a helpless but pretty girl get the man of her dreams, while falling in love in the process with her handsome neighbour named Burak.

I recommend anyone to watch it. It truly is one to watch. I&apos;m not one for rom-coms but this Turkish gems is one to watch no doubt about it.', 'reviewRating': {'worstRating': 1, 'bestRating': 10, 'ratingValue': 7}}
